/** @jsxImportSource @emotion/react */
import { css } from '@emotion/react';

const divStyle = css`
  background-color: hotpink;
  font-size: 24px;
  border-radius: 4px;
  padding: 32px;
  text-align: center;
  &:hover {
    color: white;
  }
`;

const Button = ({ onClick }) => {
  return (
    <div css={divStyle} onClick={onClick}>
      Hover to change color.
    </div>
  );
};

export default Button;
